const BASE_URL = 'http://localhost:3000'
const TODOS_URL = `${BASE_URL}/todos`
const FETCH_TODOS = 'FETCH_TODOS'

export const fetchTodos = (todos) => dispatch =>  {
    // console.log('fetching...')
        fetch(TODOS_URL)
        .then(res => res.json())
        .then(todos => 
            dispatch({
            type: FETCH_TODOS,
            todos
        })
    )
}
